const getActivityType = prop("oae:activityType");
// Variable that keeps track of the different activity types that are used for comment activities
const COMMENT_ACTIVITY_TYPES = [
    "content-comment",
    "folder-comment",
    "discussion-message",
    "meeting-jitsi-message",
];
